fmt::Formatter::<'a>::align.doc:
Returns a flag indicating what form of alignment was requested.

# Examples

```
use std::fmt::{self, Alignment};

struct Foo;

impl fmt::Display for Foo {
    fn fmt(&self, formatter: &mut fmt::Formatter<'_>) -> fmt::Result {
        let s = if let Some(s) = formatter.align() {
            match s {
                Alignment::Left    => "left",
                Alignment::Right   => "right",
                Alignment::Center  => "center",
            }
        } else {
            "into the void"
        };
        write!(formatter, "{s}")
    }
}

assert_eq!(format!("{Foo:<}"), "left");
assert_eq!(format!("{Foo:>}"), "right");
assert_eq!(format!("{Foo:^}"), "center");
assert_eq!(format!("{Foo}"), "into the void");
```

str::lossy::<impl [u8]>::utf8_chunks.doc:
Creates an iterator over the contiguous valid UTF-8 ranges of this
slice, and the non-UTF-8 fragments in between.

See the [`Utf8Chunk`] type for documentation of the items yielded by this iterator.

# Examples

This function formats arbitrary but mostly-UTF-8 bytes into Rust source
code in the form of a C-string literal (`c"..."`).

```
use std::fmt::Write as _;

pub fn cstr_literal(bytes: &[u8]) -> String {
    let mut repr = String::new();
    repr.push_str("c\"");
    for chunk in bytes.utf8_chunks() {
        for ch in chunk.valid().chars() {
            // Escapes \0, \t, \r, \n, \\, \', \", and uses \u{...} for non-printable characters.
            write!(repr, "{}", ch.escape_debug()).unwrap();
        }
        for byte in chunk.invalid() {
            write!(repr, "\\x{:02X}", byte).unwrap();
        }
    }
    repr.push('"');
    repr
}

fn main() {
    let lit = cstr_literal(b"\xferris the \xf0\x9f\xa6\x80\x07");
    let expected = stringify!(c"\xFErris the ðŸ¦€\u{7}");
    assert_eq!(lit, expected);
}
```

iter::traits::iterator::Iterator::map.doc:
Takes a closure and creates an iterator which calls that closure on each
element.

`map()` transforms one iterator into another, by means of its argument:
something that implements [`FnMut`]. It produces a new iterator which
calls this closure on each element of the original iterator.

If you are good at thinking in types, you can think of `map()` like this:
If you have an iterator that gives you elements of some type `A`, and
you want an iterator of some other type `B`, you can use `map()`,
passing a closure that takes an `A` and returns a `B`.

`map()` is conceptually similar to a [`for`] loop. However, as `map()` is
lazy, it is best used when you're already working with other iterators.
If you're doing some sort of looping for a side effect, it's considered
more idiomatic to use [`for`] than `map()`.

[`for`]: ../../book/ch03-05-control-flow.html#looping-through-a-collection-with-for

# Examples

Basic usage:

```
let a = [1, 2, 3];

let mut iter = a.iter().map(|x| 2 * x);

assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), Some(4));
assert_eq!(iter.next(), Some(6));
assert_eq!(iter.next(), None);
```

If you're doing some sort of side effect, prefer [`for`] to `map()`:

```
# #![allow(unused_must_use)]
// don't do this:
(0..5).map(|x| println!("{x}"));

// it won't even execute, as it is lazy. Rust will warn you about this.

// Instead, use a for-loop:
for x in 0..5 {
    println!("{x}");
}
```

iter::traits::iterator::Iterator::sum.doc:
Sums the elements of an iterator.

Takes each element, adds them together, and returns the result.

An empty iterator returns the *additive identity* ("zero") of the type,
which is `0` for integers and `-0.0` for floats.

`sum()` can be used to sum any type implementing [`Sum`][`core::iter::Sum`],
including [`Option`][`Option::sum`] and [`Result`][`Result::sum`].

# Panics

When calling `sum()` and a primitive integer type is being returned, this
method will panic if the computation overflows and overflow checks are
enabled.

# Examples

```
let a = [1, 2, 3];
let sum: i32 = a.iter().sum();

assert_eq!(sum, 6);

let b: Vec<f32> = vec![];
let sum: f32 = b.iter().sum();
assert_eq!(sum, -0.0_f32);
```

fmt::Formatter::<'a>::width.doc:
Returns the optionally specified integer width that the output should be.

# Examples

```
use std::fmt;

struct Foo(i32);

impl fmt::Display for Foo {
    fn fmt(&self, formatter: &mut fmt::Formatter<'_>) -> fmt::Result {
        if let Some(width) = formatter.width() {
            // If we received a width, we use it
            write!(formatter, "{:width$}", format!("Foo({})", self.0), width = width)
        } else {
            // Otherwise we do nothing special
            write!(formatter, "Foo({})", self.0)
        }
    }
}

assert_eq!(format!("{:10}", Foo(23)), "Foo(23)   ");
assert_eq!(format!("{}", Foo(23)), "Foo(23)");
```

fmt::Formatter::<'a>::fill.doc:
Returns the character used as 'fill' whenever there is alignment.

# Examples

```
use std::fmt;

struct Foo;

impl fmt::Display for Foo {
    fn fmt(&self, formatter: &mut fmt::Formatter<'_>) -> fmt::Result {
        let c = formatter.fill();
        if let Some(width) = formatter.width() {
            for _ in 0..width {
                write!(formatter, "{c}")?;
            }
            Ok(())
        } else {
            write!(formatter, "{c}")
        }
    }
}

// We set alignment to the right with ">".
assert_eq!(format!("{Foo:G>3}"), "GGG");
assert_eq!(format!("{Foo:t>6}"), "tttttt");
```

